pragma solidity ^0.5.0;
//pragma experimental ABIEncoderV2;

contract SCon {
    struct scon {
        uint id;
        string title;
        string owner;
        string client;
        string description;
        uint period;
        uint contractValue;
        string status;
    }

    struct inserting {
        string title;
        string owner;
        string client;
        string description;
        uint period;
        uint contractValue;
        string status;
    }

    mapping(uint=>scon) public scons;

    uint public sconCount;

    event votedEvent (
        uint indexed _candidateId
    );

    function createSCon (inserting memory contracts) private {
        sconCount++;
        string memory title = contracts.title;
        string memory owner = contracts.owner;
        string memory client = contracts.client;
        string memory desc = contracts.description;
        uint period = contracts.period;
        uint value = contracts.contractValue;
        string memory status = contracts.status;

        scons[sconCount] = scon(sconCount, title, owner, client, desc, period, value, status);
    }

    function createStruct
    (string memory title, string memory owner, string memory client, uint period, uint value) public {
        inserting memory con;

        con.title = title;
        con.owner = owner;
        con.client = client;
        con.period = period;
        con.contractValue = value;
        //con.description = desc;
        con.status = 'pending';

        createSCon(con);
    }

    constructor() public {
        inserting memory con;
        inserting memory con2;

        con.title = '1';
        con.owner = 'Shrijal Kaphle';
        con.client = '1';
        con.period = 1;
        con.contractValue = 1;
        con.description = '1';
        con.status = 'pending';

        con2.title = '1';
        con2.client = 'Shrijal Kaphle';
        con2.owner = '1';
        con2.period = 1;
        con2.contractValue = 1;
        con2.description = '1';
        con2.status = 'pending';
        
        createSCon(con);
        createSCon(con2);
    }

    function remove(uint addr) public {
        delete(scons[addr]);
    }
}
